    for i in range(len(worker_assignment)):
        if i == 0:#全能工
            cost = worker_assignment[0] * len(SKILL_LEVEL[0]) * unit_trainingcost
            #print('全能工cost',cost)
        else:
            cost = worker_assignment[i] * sum_seru_products[i-1] * unit_trainingcost
