def local_search_one(pop,neighbour_num): # 共享全能工+单元 加t减t策略，注意这里的共享工人可能为0
    #print('邻域1',pop)
    neighbours = []
    neighbours_objective = []
    k = 0
    index = [i for i in range(1,len(pop[0]))]
    #print('index',index)
    k = 0
    while k < neighbour_num: # 生成要求数量的邻域，一定都是可行解
        temp_pop = copy.deepcopy(pop)
        # 共享工人为0的时候，选择的单元人数不能为1
        if temp_pop[0][0] == 0: 
            optional_seru = [i for i in index if temp_pop[0][i] > 1]
            #print('可选择的单元optional_seru',optional_seru)
            random_seru = random.choice(optional_seru)
            #print('random_seru',random_seru)
        # 共享工人不为0，选择的单元可以随意  
        else:
            random_seru = random.choice(index)#随机选择一个单元索引
            #print('random_seru',random_seru)
        # 根据全能工和单元人数进行调整
        # 情况1：全能工=0，单元人数大于1；则全能工+t，单元-t
        if temp_pop[0][0] == 0 :
            adjust_range = [i for i in range(1,temp_pop[0][random_seru])]
            #print('adjust_range',adjust_range)
            adjust = random.choice(adjust_range)
            #print('adjust',adjust)
            temp_pop[0][0] = temp_pop[0][0] + adjust
            temp_pop[0][random_seru] = temp_pop[0][random_seru] - adjust
        # 情况2：全能工=1，单元人数=1；则全能工+1，单元-1
        elif temp_pop[0][0] == 1 and temp_pop[0][random_seru] == 1 :
            temp_pop[0][0] = temp_pop[0][0] - 1
            temp_pop[0][random_seru] = temp_pop[0][random_seru] + 1
        # 情况3：全能工=1，单元人数>1；则全能工-1，单元+1；或 则全能工+t，单元-t
        elif temp_pop[0][0] == 1 and temp_pop[0][random_seru] > 1 :
            random_num = random.random() #随机数用于判断如何调整
            if random_num <= 0.5: #共享工人数量-1，单元工人+1
                temp_pop[0][0] = temp_pop[0][0] - 1
                temp_pop[0][random_seru] = temp_pop[0][random_seru] + 1
            else:# 全能工+t，单元-t
                adjust_range = [i for i in range(1,temp_pop[0][random_seru])]
                #print('adjust_range',adjust_range)
                adjust = random.choice(adjust_range)
                #print('adjust',adjust)
                temp_pop[0][0] = temp_pop[0][0] + adjust
                temp_pop[0][random_seru] = temp_pop[0][random_seru] - adjust
        # 情况4：全能工>1，单元人数=1；则全能工-t，单元+t
        elif temp_pop[0][0] > 1 and temp_pop[0][random_seru] == 1: 
            adjust_range = [i for i in range(1,temp_pop[0][0])]
            #print('adjust_range',adjust_range)
            adjust = random.choice(adjust_range)
            #print('adjust',adjust)
            temp_pop[0][0] = temp_pop[0][0] - adjust
            temp_pop[0][random_seru] = temp_pop[0][random_seru] + adjust
        # 情况5：全能工>1，单元人数>1；则全能工-t，单元+t；或 则全能工+t，单元-t        
        else:
            if temp_pop[0][0] < temp_pop[0][random_seru]:
                min_seru, max_seru = 0, random_seru
            else:
                min_seru, max_seru = random_seru, 0
            #print('min_seru, max_seru',min_seru, max_seru)    
            random_num = random.random() # 随机产生一个数，判断调整方式
            #print('random_num',random_num)
            if random_num <= 0.5:#人数多的调增，人数少的调减
                #print('人数多的调增，人数少的调减')
                adjust_range = [i for i in range(1,temp_pop[0][min_seru])]
                #print('adjust_range',adjust_range)
