def epsilon_greedy_action(state, Q, epsilon):
    if np.random.uniform(0, 1) < epsilon:
        # 以概率ε选择一个随机动作
        action = np.random.randint(0, 5) #0,1,2,3,4 #random.randint 使用闭区间 [a, b]，而 np.random.randint 使用半开区间 [low, high)
        print('随机选择action',action)
    else:
        # 选择具有最大Q值的动作
        action = np.argmax(Q[state, :])
        print('最大Q值action',action)
    return action

# 注意：这里的obj_pops1是邻域目标值；obj_pops2是原种群目标值
# 如果 reward 的值为正数，那么可以说种群1在Pareto优势性上优于种群2
def calculate_reward(obj_pops1, obj_pops2):
    reward = 0
    for p in range(len(obj_pops1)):
        #print('obj_pops1[p]',obj_pops1[p])
        p_dominate_q = 0
        q_dominate_p = 0
        for q in range(len(obj_pops2)):
            #print('obj_pops2[q]',obj_pops2[q])
            if (obj_pops1[p][0] <= obj_pops2[q][0] and obj_pops1[p][1] < obj_pops2[q][1]) or (obj_pops1[p][0] < obj_pops2[q][0] and obj_pops1[p][1] <= obj_pops2[q][1]): #p支配q
                p_dominate_q += 1
                #print('p_dominate_q',p_dominate_q)
            elif (obj_pops1[p][0] >= obj_pops2[q][0] and obj_pops1[p][1] > obj_pops2[q][1]) or (obj_pops1[p][0] > obj_pops2[q][0] and obj_pops1[p][1] >= obj_pops2[q][1]): #q支配p    
                q_dominate_p += 1
                #print('q_dominate_p',q_dominate_p)
        reward += p_dominate_q - q_dominate_p
    #print('reward',reward)
    return reward
    
def generate_neighbour_pops(select_front,front_set,population,action,neighbour_num):
    neibor_population = []
    neibor_objective = []
    # 1. 从子代种群中选取前neighbour_front中的个体进行邻域搜索(选出好的个体进行邻域搜索)
    select_index = []
    for i in range(select_front):
        #print('i',i)
        for j in front_set[i]:
            #print('j',j)
            select_index.append(j)
    #print('被选出参加局部搜索的个体select_index',select_index)
    select_pops = [population[i] for i in select_index]
    # 2. 对选择个体进行邻域搜索
    for i in range(len(select_pops)):
        #print('i',i)
        if action == 0:
            neibor_pops,neibor_obj = local_search_one(select_pops[i],neighbour_num)
        elif action == 1:
            neibor_pops,neibor_obj = local_search_two(select_pops[i],neighbour_num)
        elif action == 2:
            neibor_pops,neibor_obj = local_search_three(select_pops[i],neighbour_num)
        elif action == 3:
            neibor_pops,neibor_obj = local_search_four(select_pops[i],neighbour_num)
        else:
            neibor_pops,neibor_obj = local_search_five(select_pops[i],neighbour_num)
        #print('neibor_pops',neibor_pops)
        #print('neibor_obj',neibor_obj)
        for j in range(len(neibor_pops)):
            if neibor_obj[j] not in neibor_objective:
                neibor_population.append(neibor_pops[j])
                neibor_objective.append(neibor_obj[j])
    #print('neibor_population',neibor_population)
    #print('neibor_objective',neibor_objective)
    return  neibor_population, neibor_objective       
 
def update_q_table(q_table, state, action, next_state, reward, learning_rate, discount_factor):
    current_q = q_table[state][action]
    #print('current_q',current_q)
    max_next_q = max(q_table[next_state])
    #print('max_next_q',max_next_q)
    new_q = current_q + learning_rate * (reward + discount_factor * max_next_q - current_q)
    #print('new_q',new_q)
    q_table[state][action] = new_q
    return q_table

# 生成参考点，只与参考点数量和目标数量有关，与具体问题无关
def generate_reference_points(M, H):
    """
    产生（超）平面上的参考点
    如果维数超过二维，需要通过Das and Dennis’s method获得参考点
    参数：
    M: 目标数
    H: 目标值划分的数目
    返回：
    referencepointset: 参考点集合，每个元素是一个double类型的列表，代表一个参考点的坐标
    """
    referencepointset = []
    valueOfTC = [0.0] * H
    valueOfSL = [0.0] * H
    
    for i in range(H):
        valueOfTC[i] = (i + 1) / H
        valueOfSL[i] = (i + 1) / H
        
    for i in range(H):
        for j in range(H):
            if abs(valueOfTC[i] + valueOfSL[j] - 1) < 1e-6:
                point = [0.0] * 2
                point[0] = valueOfTC[i]
                point[1] = valueOfSL[j]
                referencepointset.append(point)
    return referencepointset

#对种群个体进行归一化处理，输入：一个种群，输出：归一化点集
#输入的是一个种群的目标值，输出的是归一化的目标值
def normalization(pops_objective):
    #注：归一化处理的所有目标应该是同一类型（最大化或最小化），如果目标不同需要进行处理
    adjust_pops_objective = [[obj1, -obj2] for obj1, obj2 in pops_objective]
    #print('adjust_pops_objective',adjust_pops_objective)
    #为了后面与原种群个体相匹配，这里添加上每一个个体的索引
    addindex_popsobjective = [[] for i in range(len(pops_objective))]
    for i in range(len(pops_objective)):
        addindex_popsobjective[i].append(i)
        addindex_popsobjective[i].append(adjust_pops_objective[i])
        addindex_popsobjective[i].append(pops_objective[i])
    #print('addindex_popsobjective', addindex_popsobjective)
    #------计算理想点------
    idealpoint = [0, 0]
    addindex_popsobjective = sorted(addindex_popsobjective, key=lambda x: x[1][0])#按照第一个目标升序排序
    #print('按第1个目标值排序addindex_popsobjective', addindex_popsobjective) 
    idealpoint[0] = addindex_popsobjective[0][1][0]
    addindex_popsobjective = sorted(addindex_popsobjective, key=lambda x: x[1][1])#按照第二个目标升序排序
    #print('按第2个目标值排序addindex_popsobjective', addindex_popsobjective) 
    idealpoint[1] = addindex_popsobjective[0][1][1]
    #print('##############idealpoint',idealpoint)
    #------计算极值点------
    extremepoints = []
    w1 = [1, 0.000001]
    w2 = [0.000001, 1]
    #计算每个个体距离X轴的距离和距离Y轴的距离
    points = []
    for i in range(len(addindex_popsobjective)):# 遍历种群中的每个个体
        point = [] #[ID,个体的两个目标函数值,距离参考点（即理想点）的偏移量,DistanceX,DistanceY,NCoordinates]
        point.append(addindex_popsobjective[i][0])#这里添加的是种群中每个个体的索引
        point.append(addindex_popsobjective[i][2])
        point.append([addindex_popsobjective[i][1][0], addindex_popsobjective[i][1][1]])#个体坐标
        point.append([addindex_popsobjective[i][1][0] - idealpoint[0], addindex_popsobjective[i][1][1] - idealpoint[1]])
        #print('##############初添加point',point)
        tem1 = []
        for j in range(2):
            tem1.append(point[3][j] / w1[j])
        #print('tem1',tem1)
        point.append(max(tem1)) #添加DistanceX
        #print('##############添加DistanceXpoint',point)
        tem2 = []
        for j in range(2):
            tem2.append(point[3][j] / w2[j])
        #print('tem2',tem2)
        point.append(max(tem2)) #添加DistanceY
        #print('##############添加DistanceYpoint',point)
        points.append(point)
    #print('##############points',points)
    #获得极值点
    minX = float('inf')#表示分别在x轴和y轴上的最小距离
    minY = float('inf')
    a1 = float('-inf')#a1,a2分别用于记录种群中所有个体的第一和第二目标函数的最大值。
    a2 = float('-inf')
    for i in range(len(points)):
        if a1 < points[i][2][0]:
            a1 = points[i][2][0]
        if a2 < points[i][2][1]:
            a2 = points[i][2][1]
        #print('##############a1', a1)
        #print('##############a2', a2)
        if minX > points[i][4]:
            minX = points[i][4]
            minDistanceX = copy.deepcopy(points[i])
        #print('minDistanceX',minDistanceX)
        if minY > points[i][5]:
            minY = points[i][5]
            minDistanceY = copy.deepcopy(points[i])
        #print('minDistanceY',minDistanceY)
    extremepoints.append(minDistanceX)
    extremepoints.append(minDistanceY)
    #截距不存在，则设置为该目标上的最大值
    a = [a1, a2]
    #print('a',a)
    #------归一化------计算种群中每个个体归一化后的坐标值 NCoordinates
    for s in range(len(points)):
        NCoordinates = [0.0, 0.0]
        tem0 = a[0] - idealpoint[0]
        tem1 = a[1] - idealpoint[1]
        NCoordinates[0] = points[s][3][0] / tem0
        NCoordinates[1] = points[s][3][1] / tem1
        points[s].append(NCoordinates)
    #print('###添加归一化处理的结果###',points)
    points = sorted(points, key=lambda x: x[0])#按照个体编号从小到大排序
    points_set = [[item[0], item[1], item[-1]] for item in points]
    #print('######按个体排序',points)
    return points_set #[[个体编号,[个体目标值],[个体的坐标]],[]]

# 找到种群中每个个体距离最近的参考点和参考线
# 注意，在产生下一代中，这里的个体是St中的个体（包括Fl）
def association(reference_point_set, points_set):
    copy_points_set = copy.deepcopy(points_set)
    # 计算种群中每个个体距离参考点的距离以及距离最近的参考点（可能为0,1或者多个）
    #记录[[个体编号,[个体目标值],[个体的坐标],最近参考点坐标(可能为0,1或者多个)pi(s),最短距离d(s)],]
    distance_set = copy_points_set
    for i in range(len(points_set)):#遍历St所有个体
        distance_to_reference_points = []
        nearest_reference_points = []
        min_distance = 1000000
        for j in range(len(reference_point_set)):
            # 计算个体到参考线的垂直距离
            r = (copy_points_set[i][-1][0] * reference_point_set[j][0] + copy_points_set[i][-1][1] * reference_point_set[j][1]) / (reference_point_set[j][0] * reference_point_set[j][0] + reference_point_set[j][1] * reference_point_set[j][1])
            d1 = copy_points_set[i][-1][0] - r * reference_point_set[j][0]
            d2 = copy_points_set[i][-1][1] - r * reference_point_set[j][1]
            d = math.sqrt(d1 * d1 + d2 * d2)
            if min_distance > d:#最近的参考点可以是多个，但是最近的距离只能有一个
                min_distance = d
                nearest_reference_points = [reference_point_set[j]]
                nearest_distance = min_distance
            elif d == min_distance:
                nearest_reference_points.append(reference_point_set[j])
            distance_to_reference_points.append(d)
        distance_set[i].append(distance_to_reference_points)
        distance_set[i].append(nearest_reference_points)
        distance_set[i].append(nearest_distance)
    #print('distance_set',distance_set)
    distance_set = [item[:3] + item[4:] for item in distance_set]
    #print('删除某项后distance_set',distance_set)
    return distance_set

#  锦标赛选择，输入的pop_distance是拥挤距离，和frontnumber的序号对应
def tournament_selection(frontnumber, pop_distance, tournament_size):
    """
    二元锦标赛选择
    :param population: 种群
    :param fronts: 种群的非支配排序集合
    :param distances: 种群个体与所有参考点的距离平均值集合
    :param tournament_size: 锦标赛规模
    :return: 选择出的个体索引
    """
    selected_indices = []
    for i in range(2):#选两个个体
        tournament_indices = random.sample(range(len(frontnumber)), tournament_size)
        #print('tournament_indices',tournament_indices)
        best_index = tournament_indices[0]
        for j in tournament_indices[1:]:
            if frontnumber[j] < frontnumber[best_index]:
                best_index = j
            elif frontnumber[j] == frontnumber[best_index] and pop_distance[best_index][1] < pop_distance[j][1]:
                best_index = j
        selected_indices.append(best_index)
    #print('selected_indices',selected_indices)
    return selected_indices

#交叉算子，交叉技能水平部分，注意交叉后可能会成为不可行解
def crossover(pop1, pop2):
    copypop1 = copy.deepcopy(pop1)
    copypop2 = copy.deepcopy(pop2)
    seru_skill_one = copypop1[1]
    seru_skill_two = copypop2[1]
    #print('seru_skill_one',seru_skill_one)
    #print('seru_skill_two',seru_skill_two)
    # 随机选择两个交叉点
    index1 = np.random.randint(0, len(seru_skill_one) - 1)
    index2 = np.random.randint(index1, len(seru_skill_one))
    #print('index1',index1)
    #print('index2',index2)
    # 存储交叉点之间的代码
    code1 = seru_skill_one[index1:index2+1]
    code2 = seru_skill_two[index1:index2+1]
    # 交换两个交叉点之间的代码
    seru_skill_one[index1:index2+1] = code2
    seru_skill_two[index1:index2+1] = code1
    # 返回交叉后的两个个体
    newpops = []
    newpop_one = [copypop1[0]]
    newpop_two = [copypop2[0]]
    newpop_one.append(seru_skill_one)
    newpop_two.append(seru_skill_two)
    #print('newpop_one',newpop_one)
    #print('newpop_two',newpop_two)
    newpops.append(newpop_one)
    newpops.append(newpop_two)
    return newpops

#突变算子，对工人分配进行突变，任选两个单元或全能工池和单元，交换它们的工人分配
# 变异算子，对任意单元的技能水平进行突变
def mutation(pop):
    copypop = copy.deepcopy(pop)
    #print('copypop',copypop)
    skill_seru = copypop[1]
    index = [i for i in range(len(skill_seru))]
    #print('index',index)
    select_index = np.random.choice(index)
    #print('select_index',select_index)
    copypop[1][select_index] = random.randint(1,len(SKILL_LEVEL)-1)
    #print('copypop',copypop)
    return copypop

# 这里的distance是个体间的拥挤距离与NSGAII相似
# 通过 NSGA3 进化种群，产生子代
def get_offspring(population,frontnumber,crowd_distance): #输入父代，输出子代及子代目标值
    offspring = []
    offspring_objective = []
    #print('下一代函数中输入的crowd_distance',crowd_distance)
    # 将distances按照个体编号顺序排序
    pop_crowd_distance = [p for layer in crowd_distance for p in layer]
    #print('下一代函数中pop_crowd_distance',pop_crowd_distance)
    pop_crowd_distance.sort(key=lambda x: x[0])
    #print('排序后pop_crowd_distance',pop_crowd_distance)
    while len(offspring) < len(population):#产生子代
        #print('进入产生下一代的循环len(offspring)',len(offspring))
        # Step1：锦标赛选择，选择两个个体
        parent_index = tournament_selection(frontnumber,pop_crowd_distance, 2)
        #print('选择的个体编号', parent_index)
        parents = [population[i] for i in parent_index]
        #print('选择的个体parents',parents)
        # Step2：交叉
        newpops = [] #其中至少含有一个个体
        rc = random.random() #随机产生一个数
        #print('rc',rc)
        if ((rc <= cross_rate) and (parent_index[0] != parent_index[1])): #发生交叉，产生两个新个体
            #print("发生交叉")
            newpops = crossover(parents[0], parents[1])#cp中有两个个体
            #print("newpops",newpops)
        else: #没有发生交叉，任意选择一个个体按照概率发生变异
            #print("没有发生交叉")
            #随机选择一个个体，按照概率发生变异
            random_num = random.randint(0, 1)#从0和1中随机选择一个数
            #print('random_num',random_num)
            pop = parents[random_num]
            #print('交叉个体pop',pop)
            #随机产生一个数，判断是否发生变异
            rm = random.random()
            #print('rm',rm)
            if (rm <= mutation_rate):#发生变异
                newpops.append(mutation(pop))
                #print("发生变异", newpops)
            else:#没有发生变异
                newpops.append(pop)
                #print("没有发生变异",newpops)
        #修复策略：判断是否是可行解，如果不是可行解需要修复
        repairedpops = []
        for i in newpops:#遍历遗传后的个体
            #print('变异后的个体i',i)
            if is_feasible_solution(i) is True:
                repairedpops.append(i)
                #print('变异后代是可行解添加')
            else:#不是可行解则修复后添加
                #print("不是可行解",i)
                repair_pop = repair(i)
                repairedpops.append(repair_pop)
        #print('repairedpops',repairedpops)
        #去重，子代中已经有的个体不添加,注意：是个体目标值是否相同，不是个体是否相同
        pop_objective=[]
        for i in repairedpops:
            pop_objective = [compute_trainingcost(i),average_servicelevel(i)]
            #print('pop_objective',pop_objective)
            if pop_objective not in offspring_objective:
                offspring.append(i)
                offspring_objective.append(pop_objective)
            else:
                continue
        #print('offspring',offspring)
        #print('offspring_objective',offspring_objective)
    offspring = offspring[:len(population)]
    offspring_objective = offspring_objective[:len(population)]
    #print('最终offspring',offspring)
    #print('最终offspring_objective',offspring_objective)
    return offspring,offspring_objective

#三个种群合并，去除重复个体，重复个体是指两个目标值均相等的个体
#输出去重的合并种群，及其目标值
def combine_population(population1,objective1,population2,objective2,population3,objective3):#输入父代种群和子代种群，输出新种群
    #初始化合并种群为父代种群
    con_pops = population1 
    con_objective = objective1
    #print('con_pops',con_pops)
    #遍历子代种群的每个个体，将目标值不同的个体添加进合并种群
    for i in range(len(population2)):
        #print('population2',population2)
        if  objective2[i] not in con_objective:
            #print('不在父代种群中')
            con_pops.append(population2[i])
            con_objective.append(objective2[i])
    #遍历邻域种群，将将目标值不同的个体添加进合并种群    
    for l in range(len(population3)):
        if objective3[l] not in con_objective:
            #print('No邻域个体不在合并种群中')
            con_pops.append(population3[l])
            con_objective.append(objective3[l])
    #print('con_pops',con_pops)
    #print('con_objective',con_objective)
    return con_pops,con_objective


#计算参考点的小生境。注意，个体的范围很重要，即输入的distance_set，这里是St/Fl
def calculate_niches(reference_point_set, distance_set):
    #print('输入的distance_set',distance_set)
    niches = [] #[[参考点坐标，niches]]
    for i in range(len(reference_point_set)): #遍历所有参考点
        #print("i",i)
        tem_point = [reference_point_set[i], 0] #用于存放该参考点的信息
        # 计算种群中和这个参考点相联系的个体数量，即为 Niche
        for j in range(len(distance_set)): #遍历St/Fl中所有个体
            #print('个体j的关联参考点distance_set[j]',distance_set[j])
            tempt = distance_set[j][3] #存储该个体的信息[个体编号,[个体目标值],[个体坐标],nearest_reference_points,nearest_distance]
            #print("个体的最近参考点tempt",tempt)
            for s in range(len(tempt)): #遍历pi(s),即每个个体最近参考点坐标，可能是多个
                #print("s",s)
                # 判断个体的最近参考点中是否有该参考点
                if (tempt[s][0] == tem_point[0][0] and tempt[s][1] == tem_point[0][1]):
                    tem_point[1] += 1
        #print('tem_point',tem_point)
        niches.append(tem_point)
    #print('niches',niches )
    return niches 

# 在给定的种群中，查找与指定参考点具有相同坐标的个体
def find_pops_for_selection(min_niches_for_reference,distance_set):
    #print('distance_set',distance_set)
    select = [] # [与指定参考点具有相同坐标的个体信息]
    for j in range(len(distance_set)): #遍历St/Fl中所有个体
        tempt = distance_set[j] #存储该个体的信息[个体编号,[个体目标值],[个体坐标],nearest_reference_points,nearest_distance]
        #print('tempt',tempt)
        for s in range(len(tempt[3])): #遍历个体相关联的所有参考点
            # 判断个体的最近参考点中是否有该参考点
            if (tempt[3][s][0] == min_niches_for_reference[0] and tempt[3][s][1] == min_niches_for_reference[1]):
                select.append(tempt) 
    return select
 
def produce_new_parent_population(conpopulation,con_objective,reference_point_set,points_set,frontset_index,popsize):#输入合并种群和种群规模，输出新父代种群
    #定义列表
    new_parents = [] #新父种群
    new_objective = [] #新父种群目标值列表
    new_points_set = [] #新父种群对应的标准化的点集
    number = 0 #记录front层
    while (len(new_parents) < popsize):
        if ((len(new_parents) + len(frontset_index[number])) <= popsize):
            #print("整层加入")
            for i in frontset_index[number]:#整层加入
                new_parents.append(conpopulation[i])
                new_objective.append(con_objective[i])
                new_points_set.append(points_set[i])
            #print("########new_objective",new_objective)
            #print("########new_points_set",new_points_set)
            number += 1
        else: # 否则从最后一个前沿中根据选择机制选取其余解，解的选择是基于参考点
            #print("这一层不能全部加入",frontset_index[number]) #number是首次满足个体数量超出popsize的前沿
            #print("con_objective",con_objective)
            count_of_new_parents = len(new_parents)
            K = popsize - count_of_new_parents 
            #print("需要选择的个体数量K",K)
            # 联系个体与参考点，个体是St中的个体，即包含Fl层的个体
            st_points_set = new_points_set
            for l in frontset_index[number]:
                st_points_set.append(points_set[l])
            st_points_distance_set = association(reference_point_set, st_points_set)
            #print('#########st_points_distance_set',st_points_distance_set)
            # 计算种群st/Fl中个体的distance
            new_parents_distance = st_points_distance_set[:-len(frontset_index[number])]
            #print("#####new_parents_distance",new_parents_distance) 
            # 计算参考点的小生境，注意，在St/Fl中
            niches = calculate_niches(reference_point_set,new_parents_distance) #[[参考点坐标，Niche],]
            #print('niches', niches)
            # 计算种群Fl中个体的distance
            next_front_distance = st_points_distance_set[-(len(frontset_index[number])):]
            #print("#####next_front_distance",next_front_distance) 
            # 遍历所有参考点,在Fl中找到与每个参考点具有相同坐标的个体
            for i in range(len(reference_point_set)):
                select_pop = find_pops_for_selection(reference_point_set[i], next_front_distance)
                #print('select_pop', select_pop)
                niches[i].append(select_pop) #[[参考点坐标,Niche,[与该参考点具有相同坐标的个体信息]],]
            #print('添加Fl信息niches', niches)   
            # 从最后一层Fl中选出K个解添加进新父种群
            add_pops,add_objective = fill_new_parent_population(K,niches,conpopulation,con_objective)
            #print("add_objective",add_objective)
            new_parents.extend(add_pops)
            new_objective.extend(add_objective)
            #print("###############new_objective",new_objective)
            number += 1
    return new_parents, new_objective

# 通过Niche-Preservation操作填充下一代种群
def fill_new_parent_population(K,niches,conpopulation,con_objective):
    copy_niches = copy.deepcopy(niches) 
    add_pops = []
    add_objective = []
    k = 0
    # ------选择K个个体补充种群------
    while k < K:
        #print('##################k########', k)
        # ------找出Niches最小的参考点------
        min_niches = 100000 #最小的Niche值
        min_niches_for_reference = [] #最小的Niche值对应的参考点信息[[参考点坐标,Niche,[与该参考点具有相同坐标的个体信息]],]
        for j in range(len(copy_niches)):# 遍历所有参考点，找到具有最小Niche的参考点
            if copy_niches[j][1] < min_niches:
                min_niches = copy_niches[j][1] #Niche
                min_niches_for_reference = copy.deepcopy(copy_niches[j]) #最小Niche对应的参考点信息
        #print('min_niches_for_reference', min_niches_for_reference)
        if len(min_niches_for_reference[2]) == 0:
            # 检查minNichesForReference参考点的Select_pop列表是否为空。如果为空，表示该参考点没有与之关联的个体。将从referencePoints列表中删除与minNichesForReference具有相同坐标的参考点，并继续下一次循环。
            #print('Fl中没有相关联的个体', min_niches_for_reference[2])
            copy_niches = [x for x in copy_niches if (x[0][0] != min_niches_for_reference[0][0]) or (x[0][1] != min_niches_for_reference[0][1])]
            #print('删除没有关联个体的参考点copy_niches', copy_niches)
            continue
        #------判断这个参考点的小生境是否为0------
        else:
            #print('有相关联的个体', min_niches_for_reference[2])
            if min_niches_for_reference[1] == 0:# 选择距离该参考点最近的个体加入种群
                #print('参考点的小生境为“0”', min_niches_for_reference[1])
                # 计算参考点到当前解的距离[参考点坐标,Niche,[与该参考点具有相同坐标的个体信息]
                min_value = 100000000
                min_distance_pop = [] #用于存储具有最小距离的个体
                for s in range(len(min_niches_for_reference[2])):#遍历与参考点相关联的每个个体，计算个体到参考点的距离
                    #print('与该参考点相关联的个体s', s)
                    tem_pop = min_niches_for_reference[2][s] #个体信息[个体编号,[个体坐标],distance_to_reference_points,nearest_reference_points,nearest_distance]
                    # 注意，这里计算的是欧几里德距离，用于计算两个点之间的直线距离
                    d = math.sqrt((tem_pop[1][0] - min_niches_for_reference[0][0])** 2 + (tem_pop[1][1] - min_niches_for_reference[0][1]) ** 2)
                    #print('d', d)
                    if d < min_value:
                        min_value = d
                        min_distance_pop = copy.deepcopy(tem_pop)
                #print('最近个体的信息', min_distance_pop)
                add_pop_index = min_distance_pop[0]
                #print('添加的个体的索引', add_pop_index)
                add_pops.append(conpopulation[add_pop_index])
                add_objective.append(con_objective[add_pop_index])
                #print('添加距离最近的个体进入种群', add_objective)
                for i in range(len(copy_niches)):#遍历所有参考点，找到该参考点，在该参考点关联个体中移除添加过的个体
                    if (copy_niches[i][0][0] == min_niches_for_reference[0][0] and copy_niches[i][0][1] == min_niches_for_reference[0][1]):
                        for s in range(len(copy_niches[i][2])):#遍历关联个体，找到已经添加的个体，进行移除
                            if copy_niches[i][2][s][0] == add_pop_index:
                                copy_niches[i][2].remove(copy_niches[i][2][s])
                                break
                        break
                #print('在参考点的关联个体列表中删除该个体copy_niches', copy_niches)
            else:
                #print('参考点的小生境不为0', min_niches_for_reference[1])
                add_pop_index = min_niches_for_reference[2][0][0]
                add_pops.append(conpopulation[add_pop_index])
                add_objective.append(con_objective[add_pop_index])
                #print('添加的个体的索引', add_pop_index)
                #print('添加第一个个体进入种群', add_objective)
                #遍历所有参考点，找到该参考点，在该参考点关联个体中移除添加过的个体
                for i in range(len(copy_niches)):
                    if (copy_niches[i][0][0] == min_niches_for_reference[0][0] and copy_niches[i][0][1] == min_niches_for_reference[0][1]):
                        copy_niches[i][2].remove(copy_niches[i][2][0])
                        break
                #print('在参考点的关联个体列表中删除该个体copy_niches', copy_niches)    
            k += 1
    return add_pops,add_objective

