def merge_pareto_with_different_serus(all_pareto_pop,all_pareto_objective):
    merge_pareto_pop = all_pareto_pop[0]
    merge_pareto_objective = all_pareto_objective[0]
    for i in range(1,len(all_pareto_objective)):
        for j in range(len(all_pareto_objective[i])):
            if all_pareto_objective[i][j] not in merge_pareto_objective:
                merge_pareto_objective.append(all_pareto_objective[i][j])
                merge_pareto_pop.append(all_pareto_pop[i][j])
    return merge_pareto_pop,merge_pareto_objective

def get_sublist(lst, n, m):
    sublist = lst[:n]  # 取前 n 项
    sublist = [sub[:m] for sub in sublist]  # 对每个子列表取前 m 项
    return sublist
